import React from 'react';
import './index.css';

function Blocks(){
    
    return (
        <>
            <Nav/>
            <div className="blocks">
                <Block a="üòÑ" b="üòÑ" c="üòÑ"/>
            </div>
        </>
    );
}
function Block(props){
    let a;
    if((props.x===props.y) && (props.y===props.z)){
        a = "This is matching";
    }
    else{
        a = "this is not matching";
    }
    return (
        <>
            <div className="block"><span>{props.x}{props.y}{props.z}</span><span>{a}</span></div>
        </>
    );
}
function Nav(){
    return (<>
            <div className="nav">
            <h2>üé∞ This is my Slot Machine Game üñêÔ∏è</h2>
            </div>
    </>);
}

export default Blocks;
